import { TodoCount } from './todosComp/TodoCount';
import { CreateTodoButton } from './todosComp/CreateTodosButton';
import { TodoSearch } from './todosComp/TodoSearch';
import { TodoList } from './todosComp/TodoList';
import { TodoItem } from './todosComp/TodoItem';
import './css/styleGeneral.css';
import React from 'react';
import './App.css';
const defaultTodos = [
  { text: 'tarea 1', completed: true, swapy: 'data-swapy-item="d"' },
  { text: 'tarea 2', completed: false , swapy: 'data-swapy-item="c"'},
  { text: 'tarea 3', completed: true , swapy: 'data-swapy-item="b"'},
  { text: 'tarea 4', completed: false, swapy: 'data-swapy-item="a"' },
];
function App() {
  //JSX
  return (
    <div className='card_principal'>
      <TodoCount
        completed={5}
        total={10} />
      <TodoSearch />
      <TodoList>
        {defaultTodos.map(todo =>(
        <TodoItem 
          key={todo.text}
          text={todo.text}  
          completed={todo.completed} />
        ))}
      </TodoList>

      <CreateTodoButton />
    </div>
  );
}



export default App;
